import {cloneDeep} from "lodash";
import {INIT_SESSION, INIT_STORE_ACTION, CLEAN_SESSION, INIT_LOGOUT} from "../Constants";

export function storeReducers(state,action){
    switch(action.type){
        case INIT_SESSION:{
            const _state = cloneDeep(state);
            _state.session = {
                "login_time":new Date()
            }
            _state.user = Object.assign({},action.data);
            return _state;
        }
        case INIT_STORE_ACTION:{
            return cloneDeep(action.data)
        }
        case CLEAN_SESSION:{
            const _state = cloneDeep(state);
            _state.session = null;
            return _state;
        }
        case INIT_LOGOUT:{
            const _state = cloneDeep(state);
            _state.user = null;
            return _state;
        }
    }
}
